import React from 'react';
import Side from './sidebar';
import './Dashboard.css';
function Form(){
    return(
        <div className="dsh">
        <div className="dashboard">
        <div>
        <Side/>
        </div>
        <div className="content">
        <form>
            <label>Name:</label>
            <input type="text" placeholder="First name"/>
            <input type="text" placeholder="Last name"/>
        </form>
        </div>
        </div>
        </div>
    
    )
}
export default Form;
